import React, { Component } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
class Like extends Component {
    render() { 
        const classIcon = ['heart']
        if(!this.props.IsLiked)
            classIcon.unshift('far')
        return (         
            //<i style={{cursor: "pointer"}} onClick={()=>{this.props.onClick(this.props.movie)}} className={classIcon}></i>
            <FontAwesomeIcon style={{cursor: "pointer"}} icon={classIcon}/>
        );
    }
}
 
export default Like;
